onfinish:
try{
       if(location.href.indexOf('api.cuevana3')>1 && document.getElementsByClassName('link')[0] != undefined){
              location.replace(document.getElementsByClassName('link')[0].href);
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.indexOf('fembed/index.php')>1){
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.indexOf('index.php')>1){
              document.getElementsByTagName('form')[0].submit();
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.indexOf('api.cuevana3')>1 && location.href.indexOf('fembed')>1){
              document.getElementById('player1').click();
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.indexOf('goto')>1){
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.indexOf('tomate')>1 ||
                     location.href.indexOf('streamtape')>1 ||
                     location.href.indexOf('diasfem')>1 ||
                     location.href.indexOf('waaw')>1){
              window.HTMLOUT.processHTML(location.href);
       }else{
              window.HTMLOUT.getError();
       }
}catch(error){
       window.HTMLOUT.getError();
}
